  false,\n\t\"url\": null,\n\t\"notes\": \"This data service represents a subset of
  fisheries research carried out by the Pacific Island Fisheries Science Center (PIFSC)
  in the Mariana Archipelago.  Specific datasets included are from the Resource Assessment
  Investigation of the Mariana Archipelago (RAIOMA) from 1980-1985.  Data types included
  in this REST service include bottomfish fishing transects and shrimp trap deployment
  locations, catch tables containing records for each of the locations/transects,
  and summary level products such as catch per unit effort (CPUE) and Total Yield.\",\n\t\"license_title\":
